INSERT INTO `sys_oper_log` VALUES (430, '健康栏目', 1, 'com.ruoyi.web.controller.system.BoheWenzhangController.add()', 'POST', 1, 'admin', NULL, '/system/wenzhang', '127.0.0.1', '内网IP', '{\"content\":\"\\t为什么这么说呢？我们来看看身体在一天里的饮食安排：早上6-9点之间可能吃早餐，中午11-14点之间可能吃午餐，正常的晚餐时间大约在17-20点。如果没有晚餐，就算中午吃了很多很多，那么，午餐消化吸收在傍晚18点完成，到第二天的早餐为止，我们的身体至少10个小时处于空腹状态。如果很不凑巧，我们中午吃得也不多，下午15点就消化完了，那么我们的身体将有14个小时属于空腹状态。这么长时间的空腹，会让我们的身体认为是在闹“饥荒”，从而主动进入饥饿状态。在饥饿状态下，饮食摄入热量将更容易被转化为脂肪储存。也就是说第二天的早餐午餐将更容易转化为脂肪，这就与减肥背道而驰了。\\t而通常所见的不吃晚饭，体重会稍有下降，是肌肉大量流失造成的。而肌肉的大量流失又会让我们的代谢消耗降低，妨碍我们的减肥。\",\"createTime\":\"2024-03-17 10:49:10\",\"id\":2,\"img\":\"/profile/upload/2024/03/17/Snipaste_2024-03-16_19-53-22_20240317104909A002.png\",\"params\":{},\"title\":\"不吃晚饭不能减肥。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-03-17 10:49:10', 12);
