INSERT INTO `sys_oper_log` VALUES (547, '健康栏目', 2, 'com.ruoyi.web.controller.system.BoheWenzhangController.edit()', 'PUT', 1, 'admin', NULL, '/system/wenzhang', '127.0.0.1', '内网IP', '{\"content\":\"作者：xxxx<strong>鸡蛋，被誉为“全营养食品”，是生活中优质蛋白质的</strong>重要来源。不光是品种多，土鸡蛋、柴鸡蛋、山鸡蛋、绿色鸡蛋、特殊营养成分鸡蛋……目前，市面上所售鸡蛋的价格也是相差甚多，低至几块钱一斤，也有几十块钱一斤的。那几块钱和几十块钱的鸡蛋有什么区别？如何选购鸡蛋更健康?每天吃几个更好呢？这篇文章一起来聊聊……<strong> 为什么要吃鸡蛋？</strong>鸡蛋等蛋类食品是多种营养物质的重要和优质来源，这其中包括优质蛋白质、磷脂、维生素A、维生素E、维生素D、维生素K、B族维生素、以及多种矿物质元素（锌、铁、硒）等。蛋类食品之所以优秀，一方面是由于其富含多种营养素、种类齐全，另一方面则是由于蛋类易于消化吸收，食用对机体的补充效果较完美。因此，建议大家食用鸡蛋。市面上鸡蛋的价格相差甚大，有些鸡蛋每斤卖到3、4元，有些甚至能卖到70、80元一斤，那到底有什么区别呢？<strong> 几块钱和几十块钱的鸡蛋有啥区别？</strong>土鸡蛋，价格贵，难道其营养价值真的更高？其实，就营养物质的含量来说，<strong>土鸡蛋与普通鸡蛋中的蛋白质（氨基酸）、钙、铁、磷等主要营养物质的含量并无较大区别</strong>，只是土鸡蛋（柴鸡蛋）中的脂肪含量比普通鸡蛋略高出约1%，胆固醇的含量也稍高一些。需要注意的是，养鸡场集约化养殖产出的鸡蛋中所含的维生素和矿物质元素的含量比土鸡蛋要高，其原因是养鸡场给鸡喂食的饲料当中营养物质更为充足。此外，两类鸡的“吃食”也存在差别。与普通鸡蛋的养殖环境不同，土鸡在养殖过程中的吃食大多为青草、虫子等物质，这些物质中本身含有一些脂溶性味道成分，接下来这些物质会转移到鸡蛋中，这也是导致土鸡蛋味道更香的一则因素。综上所述，<strong>土鸡蛋和普通鸡蛋在营养物质的组成上差别不大</strong>，选择适合自己的就好。虽然高价，但安全性容易存在问题：土鸡多处于“放养”状态，而在这个过程中并不能严格控制产蛋的环境卫生，鸡蛋容易受到粪便等有害物质的污染。除此之外，由于散养土鸡的吃食复杂，土鸡蛋被沙门氏菌、李斯特菌、农药、二恶英等有害物质侵袭的风险更高，值得重视。<strong>红皮鸡蛋比白皮的更有营养？</strong>事实上并非如此。蛋壳的颜色主要由一种名为卵壳卟啉的物质决定，而这种物质没有营养价值，<strong>颜色与鸡的品种有关，与营养价值无关。</strong>除了土鸡蛋、柴鸡蛋外，市面上的山鸡蛋、绿色鸡蛋、特殊营养成分鸡蛋等产品，其和普通鸡蛋相比营养差距并不大。\",\"createTime\":\"2024-03-04 02:23:33\",\"id\":1,\"img\":\"/profile/upload/2024/03/04/Snipaste_2024-03-03_23-00-22_20240304022254A001.png\",\"params\":{},\"title\":\"几块钱和几十块钱的鸡蛋，究竟有什么区别？红皮的更有营养？这些\\\"内幕\\\"藏不住了\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-04-25 15:30:44', 11);
